import React, { useState, useEffect } from "react";
import { NativeSelect, FormControl } from "@material-ui/core";

const CountryPicker = () => {
  return (
    <FormControl className={styles.formControl}>
      <NativeSelect>
        <option>Global</option>
      </NativeSelect>
    </FormControl>
  );
};

export default CountryPicker;
